import React from "react";
import FilterVintageIcon from '@mui/icons-material/FilterVintage';
import Clock from "react-clock";
import {useState, useEffect} from "react";


function clock () {
  const [value, setValue] = useState(new Date());

  useEffect(() => {
    const interval = setInterval(() => setValue(new Date()), 1000);

    return () => {
      clearInterval(interval);
    };
  }, []);
}


function Header() {
return (
  <div>
    <p>Current time:</p>
    <Clock value={value} />
  </div>
);

  return (
    <header>
      <h1>
      <FilterVintageIcon 
      className="icon" 
      fontSize="large" />
      <FilterVintageIcon 
      className="icon" 
      fontSize="medium"/> 
      Save a note
      <FilterVintageIcon 
      className="icon"  
      fontSize="medium"/>
      <FilterVintageIcon 
      className="icon" 
      fontSize="large"/>
      </h1>
    </header>
  );
}

export default Header;
